import React from 'react'

export const AddTodo = (props) => {
    const submit = (e) => {
        e.preventDefault();
        alert("Hey i am clicked");
    }
    return (
        <div className="container my-3">
            <h3 className="text-center">Add to todos</h3>
            <form onSubmit={submit}>
                <div className="mb-3">
                    <label for="todoTitle" className="form-label">Title</label>
                    <input type="text" className="form-control" id="todoTitle" />
                </div>
                <div className="mb-3">
                    <label for="todoDescription" className="form-label">Todo Description</label>
                    <input type="text" className="form-control" id="todoDescription" />
                </div>
                <button type="submit" className="btn btn-success btn-sm">Submit</button>
            </form>
        </div>
    )
}
